import React, { useState } from 'react';
import '../App.css';

function Result() {

  let [Purpose, CalPurpose] = useState(0);
  let [Tolerance, CalTolerance] = useState(0);
  let [Literacy, CalLiteracy] = useState(0);
  let [Experience, CalExperience] = useState(0);

  let[Question, GetQuestion] = useState('투자를 시작한 이유가 궁금해요!', '1억을 투자, 1년동안 이정도는 땡겨야지!', '투자할 때 <손실>에 대한 나의 의견은?', '내 자산 10억으로 투자할 상품을 골라주세요!', '아는 투자 단어들을 모두 골라주세요!', '내가 주식을 시작한지 어언... ')

  return (
    <div className="App">
      <div className="header-nav">
        <div>투자 성향 테스트</div>
      </div>
    </div>
  );
}


export default Result;
